function inicializarMapa () {
  mapa = new google.maps.Map(document.getElementById('map'), {
    center: {lat: posicionCentral.lat, lng: posicionCentral.lng},
    zoom: 12
  });

  var paths = _.map(coordinates, function (entry) {
        return _.reduce(entry, function (list, polygon) {
            // This map() only transforms the data.
            _.each(_.map(polygon, function (point) {
                // Important: the lat/lng are vice-versa in GeoJSON
                return new google.maps.LatLng(point[1], point[0]);
            }), function (point) {
                list.push(point);
            });

            return list;
        }, []);
    });

  polygon = new google.maps.Polygon({
        paths: paths,
        strokeColor: "red",
        strokeOpacity: 0.1,
        strokeWeight: 2,
        fillColor: 'Red',
        fillOpacity: 0.1
    });

  polygon.setMap(mapa);

  geocodificadorModulo.inicializar()
  marcadorModulo.inicializar()
  direccionesModulo.inicializar()
  lugaresModulo.inicializar()
  //streetViewModulo.inicializar()
}
